import React from "react";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";
import json from "../uk-map.json";
import "../index.css";


function Map(props) {
  return (

    <div className="map-container">
        <ComposableMap width = {1000} height = {1000}>
            <Geographies geography = {json} projection = "geoMercator">
                {({geographies}) => geographies.map((geo) => <Geography key = {geo.rsm} geography = {geo} />)}

            </Geographies>
        </ComposableMap>
    </div>

  );
}

export default Map;
